# Python code for analyzing information security compliance of two employees in the same team

def assess_security_compliance(employee1, employee2):
    # Initialize variables to store information about each employee's adherence to information security policies
    compliance = 0
    non_compliance = 0

    # Check if both employees are compliant with information security policies
    for policy in employee1.policies:
        if policy.adherence == "comply":
            compliance += 1
        else:
            non_compliance += 1

    for policy in employee2.policies:
        if policy.adherence == "comply":
            compliance += 1
        else:
            non_compliance += 1

    # Calculate the risk level based on the number of policies each employee is compliant with and their adherence status
    if compliance > 0 and non_compliance == 0:
        risk_level = "The security non-compliance risk level will increase"
    elif compliance == 0 and non_compliance > 0:
            risk_level = "The security non-compliance risk level will stay the same"
    else:
            # It is impossible to tell
                risk_level = "It is impossible to tell"

    return compliance, non_compliance, risk_level

